// Projects.js
import React from 'react';
import styled from 'styled-components';
import ProjectCard from './ProjectCard'; // Import the ProjectCard component

const ProjectsContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
`;

const Projects = () => {
  return (
    <ProjectsContainer>
      <ProjectCard title="Project 1" description="This is a description of Project 1." />
      <ProjectCard title="Project 2" description="This is a description of Project 2." />
      <ProjectCard title="Project 3" description="This is a description of Project 3." />
      {/* More ProjectCards can be added here */}
    </ProjectsContainer>
  );
};

export default Projects;
